                sb.AppendLine("MPCDs =>");
                using (sb.Brace())
                {
                    foreach (var subItem in item.MPCDs)
                    {
                        using (sb.Brace())
                        {
                            subItem?.Print(sb, "Item");
                        }
                    }
                }
            }
