                        Mutagen.Bethesda.Plugins.Binary.Translations.ListBinaryTranslation<BaseLayer>.Instance.Parse(
                            reader: frame,
                            triggeringRecord: BaseLayer_Registration.TriggerSpecs,
                            translationParams: translationParams,
